apiVersion: direwolf.games-on-whales.github.io/v1alpha1
kind: App
metadata:
  generation: 1
  name: testball
  namespace: direwolf
spec:
  appAssetWebP: 
  id: 3
  isHDRSupported: false
  title: Test Ball
  volumeConfig:
    ephemeral: true #if set to false, it'll default to creating a pvc requesting 10Gi
  wolfConfig:
    startAudioServer: false
    startVirtualCompositor: false
    audio:
      source: 'audiotestsrc wave=ticks is-live=true'
    video:
      source: |
        videotestsrc pattern=ball flip=true is-live=true !
        video/x-raw, framerate={fps}/1

